import React from "react";

const List = ({ groceries }) => {
  return (

    <ul className="list-group">
     <p className="list-group-item"> { groceries.map(g=> 
    <li key={ g.id }> {g.name}</li> ) } </p>
  </ul>
  )
 }

export default List;
